{"1":"<p><a data-cke-saved-href=\"http:\/\/www.google.com\" href=\"http:\/\/www.google.com\" class=\"vt-p\">www.partenaire.com<\/a><\/p><p><a data-cke-saved-href=\"http:\/\/www.google.fr\" href=\"http:\/\/www.google.fr\" class=\"vt-p\">www.autrepartenaire.fr<\/a><\/p>","2":"<p>Contact<\/p>","3":"<p>Hey<\/p>","4":"<p>0123456789<\/p>","5":"<p>adresse@email.com<\/p>","6":"<p>3 rue du sapin<\/p><p>89789<\/p><p>Une ville en France<\/p>","7":"Bienvenue sur mon site","8":"<p>Hey<\/p>","9":"<p>Les diff\u00e9rents massages que je vous propose.<\/p>","10":"<p>L'endroit o\u00f9 je pratique, photos et pr\u00e9sentation.<\/p>","11":"<p>Toutes les nouveaut\u00e9s !<\/p>","12":"<p>Laissez moi un petit mot !<\/p>","13":"a","14":"<p>N'h\u00e9sitez pas \u00e0 me contacter pour prendre un rendez vous ou si vous avez une question.<\/p>","15":"<p>Nouveaut\u00e9s<\/p>","16":"<p>Hey<\/p>","17":"<p>Promos<\/p>","18":"<p>Hey<\/p>","19":"S\u00e9jours","20":"Hey","21":"<p>Massages<\/p>","22":"<p>Hey<\/p>","23":"<p>a<\/p>","24":"a","25":"a","26":"a","27":"a","28":"a","29":"<p>a<\/p>","30":"<p>Le massage relaxant californien : tout en lissages et mouvements lents pour&nbsp;vous faire l\u00e2cher prise,&nbsp;<span style=\"font-size: 14px;\">vous faire reprendre conscience de votre corps. <\/span><br><\/p><p><span style=\"font-size: 14px;\"><\/span><br><\/p><p><span style=\"font-size: 14px;\">Pratiqu\u00e9 avec des huiles v\u00e9g\u00e9tales bio et des huiles&nbsp;<\/span><span style=\"font-size: 14px;\">essentielles apaisantes : lavande, camomille, mandarine, g\u00e9ranium, marjolaine...<\/span><\/p>","31":"<p>Le massage ayurv\u00e9dique Abhyanga , vous aidera \u00e0 chasser les toxines, \u00e0 nettoyer votre corps et votre&nbsp;esprit. Pour appr\u00e9cier ce massage profond, &nbsp;venez en forme. <\/p><p><br><\/p><p>Pratiqu\u00e9 avec de l\u2019huile de s\u00e9same&nbsp;chaude et si vous le souhaitez des huiles essentielles toniques : g\u00e9n\u00e9vrier, niaouli, romarin, citron...<\/p>","32":"<p>Le massage chinois vous apportera l\u00e9g\u00e8ret\u00e9 et s\u00e9r\u00e9nit\u00e9. Ce protocole appel\u00e9 \u00ab chrong mai \u00bb, travaille&nbsp;<span style=\"font-size: 14px;\">sur le m\u00e9ridien central appel\u00e9 \u00ab vaisseau conception \u00bb. Je travaille sur le ventre avec un cristal de&nbsp;<\/span><span style=\"font-size: 14px;\">roche qui, \u00e0 la mani\u00e8re des aiguilles d\u2019un acupuncteur, favorise la remise en route de l\u2019\u00e9nergie.<\/span><br><\/p><p><span style=\"font-size: 14px;\">Il&nbsp;<\/span><span style=\"font-size: 14px;\">am\u00e9liore votre centrage, votre ancrage et vous permet de vous sentir align\u00e9. Pratiqu\u00e9 avec des huiles&nbsp;<\/span><span style=\"font-size: 14px;\">v\u00e9g\u00e9tales bio et des huiles essentielles d\u00e9stressantes, apaisantes.<\/span><\/p>","33":"<p>Le massage thai traditionnel &nbsp;vous assouplira, vous d\u00e9contractera : ce massage que j\u2019ai appris en&nbsp;<span style=\"font-size: 14px;\">thailande, est une vraie th\u00e9rapie du corps et de l\u2019esprit. Par des pressions, des flexions-extensions de&nbsp;<\/span><span style=\"font-size: 14px;\">vos muscles, c\u2019est un vrai cours de yoga que je vous offre de partager. Pratiqu\u00e9 au sol sur un futon,&nbsp;<\/span><span style=\"font-size: 14px;\">vous restez habill\u00e9 et je n\u2019utilise pas d\u2019huile.<\/span><\/p>","34":"<p>La r\u00e9flexologie plantaire : masser vos pieds c\u2019est comme masser tout votre corps. Apr\u00e8s 20mn de&nbsp;<span style=\"font-size: 14px;\">mouvements favorisant la d\u00e9tente et le l\u00e2cher prise, je peux travailler plus en profondeur sur les&nbsp;<\/span><span style=\"font-size: 14px;\">zones correspondant \u00e0 vos 5 organes vitaux : Foie, c\u0153ur, Rate-pancr\u00e9as, Poumons, Reins et aussi sur&nbsp;<\/span><span style=\"font-size: 14px;\">votre t\u00eate (cerveau). Vous partez, apr\u00e8s 1h de massage, avec un sentiment d\u2019harmonie interne.<\/span><\/p>","35":"<p>Le massage aux bambous : ce massage relativement r\u00e9cent, vient d\u2019Asie. Les diff\u00e9rents bambous, de&nbsp;<span style=\"font-size: 14px;\">diff\u00e9rentes tailles, sont les prolongements des mains. Les bambous aident \u00e0 lisser et \u00e0 drainer. Les&nbsp;<\/span><span style=\"font-size: 14px;\">femmes appr\u00e9cieront son effet modelant, les hommes sportifs appr\u00e9cieront la fonction d\u00e9toxifiante&nbsp;<\/span><span style=\"font-size: 14px;\">du massage. J\u2019utilise de l\u2019huile bio et des huiles essentielles astringentes :&nbsp;h\u00e9lichryse, lentique&nbsp;<\/span><span style=\"font-size: 14px;\">pistachier\u2026<\/span><\/p>","36":"<p>Le massage assis, \u00ab amma \u00bb : c\u2019est le massage anti-stress. Pratiqu\u00e9 sur une chaise ergonomique,&nbsp;<span style=\"font-size: 14px;\">je masse votre dos, vos bras, votre t\u00eate. Il dure environ 20mn et ce temps relativement court vous&nbsp;<\/span><span style=\"font-size: 14px;\">permet vraiment de l\u00e2cher prise et de repartir pour d\u2019autres activit\u00e9s. Ce massage est tr\u00e8s efficace&nbsp;<\/span><span style=\"font-size: 14px;\">pour relancer l\u2019\u00e9nergie \u00e0 la pause d\u00e9jeuner.<\/span><\/p>","37":"<p>La sophrologie<\/p>","38":"<p>Notre corps et notre esprit ne font qu\u2019un. Si les massages sont une r\u00e9ponse pour nous apporter du bien \u00eatre au corps, la sophrologie nous apporte la m\u00eame chose pour notre esprit. Et les 2 techniques combin\u00e9es forment un vrai cocktail pour l\u00e2cher prise.<br><br>Pourquoi la sophrologie ?<br>Pour nous aider \u00e0 mieux nous connaitre et \u00e0 profiter pleinement de toutes nos capacit\u00e9s.<br><br><\/p><p><br><\/p><p><br><\/p><p>Dans quelles circonstances ?<br>Un examen, un entretien ou une comp\u00e9tition \u00e0 pr\u00e9parer, pour g\u00e9rer le stress et en tirer le meilleur.<br>Un deuil, une rupture, un changement professionnel, pour trouver les ressources en nous pour passer ces caps parfois douloureux.<br>Un probl\u00e8me de conflit relationnel ou une situation conflictuelle. Comprendre ce qui a pu se passer et qu\u2019est ce que cela doit nous apprendre sur nos \u00e9motions et comment les g\u00e9rer.<br>Traiter une addiction, trouver la solution pour en sortir et en profiter durablement.<br><br>Les exercices propos\u00e9s, se font debout ou assis ou allong\u00e9 selon la demande et le besoin. Chaque entretien est enregistr\u00e9 et une copie audio vous est fournie afin de vous entrainer entre 2 s\u00e9ances. Plus vous vous entrainez, plus le travail sera efficace et rapide.<br><br>Les techniques utilis\u00e9es sont celles du professeur Caycedo mais aussi de techniques plus anciennes, d\u00e9j\u00e0 pratiqu\u00e9es par des m\u00e9decins du 19\u00e8me si\u00e8cle : Vittoz, Schultz, Jacobson.<\/p>","39":"<p>Le salon<\/p>","40":"<p>Situ\u00e9 \u00e0 la sortie de la gare SNCF de Bougival (ligne St Lazare \u2013 St Nom La Bret\u00eache), c\u00f4t\u00e9 Bar Tabac et Boulangerie, le Domen d\u2019Eve vous accueille, au sous-sol du cabinet Infirmier.<br><br>D\u00e8s l\u2019entr\u00e9e, le long couloir vous invite \u00e0 vous laisser surprendre.<br><br>Les odeurs d\u2019encens et la douce chaleur vous pr\u00e9parent au voyage.<br><\/p><p><br>Dans une atmosph\u00e8re exotique, africaine et indienne, venez appr\u00e9cier les diff\u00e9rents massages du monde.<\/p>","41":"<p>Livre d'or<\/p>","42":"<p>Hey<\/p>","43":"<p>Tarifs<\/p>","44":"<p>Hey<\/p>","45":"a","46":"a","47":"<p>Si vous voulez vivre une exp\u00e9rience diff\u00e9rente, appr\u00e9cier le m\u00e9lange d\u2019\u00e9nergies diff\u00e9rentes \u00e0 travers&nbsp;<span style=\"font-size: 14px;\">les mains de 2 masseurs, offrez vous cette pause \u00e9tonnante. Vous pouvez \u00eatre mass\u00e9 par 2 femmes&nbsp;<\/span><span style=\"font-size: 14px;\">ou par un homme et une femme.<\/span><\/p>","48":"<p>Vous pouvez vivre \u00e0 deux simultan\u00e9ment les m\u00eames sensations, le m\u00eame plaisir d\u2019\u00eatre mass\u00e9. Tous&nbsp;<span style=\"font-size: 14px;\">les massages disponibles individuellement peuvent \u00eatre pratiqu\u00e9s en couple. Vous serez coocoon\u00e9s,&nbsp;<\/span><span style=\"font-size: 14px;\">pris en charge ensemble pour un moment de partage unique.<\/span><\/p>","49":"<p>Californien<\/p>","50":"<p>50\u20ac<\/p>","51":"<p>70\u20ac<\/p>","52":"<p>Ayurv\u00e9dique<\/p>","53":"<p>50\u20ac<\/p>","54":"<p>70\u20ac<\/p>","55":"<p>Chinois<\/p>","56":"<p>50\u20ac<\/p>","57":"<p>70\u20ac<\/p>","58":"<p>R\u00e9flexologie plantaire<\/p>","59":"<p>50\u20ac<\/p>","60":"<p>70\u20ac<\/p>","61":"<p>Bambous<\/p>","62":"<p>50\u20ac<\/p>","63":"<p>70\u20ac<\/p>","64":"<p>Thai<\/p>","65":"<p>55\u20ac<\/p>","66":"<p>75\u20ac<\/p>","67":"<p>Sensitif<\/p>","68":"<p>60\u20ac<\/p>","69":"<p>85\u20ac<\/p>","70":"<p>4 mains<\/p>","71":"<p>95\u20ac<\/p>","72":"<p>-<\/p>","73":"<p>Couple<\/p>","74":"<p>95\u20ac<\/p>","75":"<p>160\u20ac<\/p>","76":"<p>Sophrologie (de 1h \u00e0 1h30)<\/p>","77":"50\u20ac","78":"-"}